import style from "./Card.module.css";
import { Link } from "react-router-dom";



export default function Card({ image, name, diets }) {
    return(
        <div class>
            <img src={image} alt="img not found" width="350px" height="250px"/>
            <h1>{name}</h1>
            {diets?.map((e, i) =>{ 
                return(
                <h3 key={i}>{e}</h3>)
                })}
        </div>
    )
}
